import React from 'react';

const Screenshots = ({ data }) => {
  return (
    <section className="screenshots">
      {data.map((screenshot, index) => (
        <img key={index} src={screenshot} alt={`Screenshot ${index + 1}`} />
      ))}
    </section>
  );
};

export default Screenshots;
